import React, { useState } from 'react'

function Searchbar() {
    const [url,setUrl]=useState('');
    const changeurl=(e)=>{
      setUrl(e.target.value);
      return 1
    }
  return (
    <div className='searchbar'>
      <input type='textbox' value={url} onChange={changeurl}>

      </input>
    </div>
  )
}

export default Searchbar
